'''Dagannoth''' are sea-based monsters that live in the [[Lighthouse]] basement (close to [[fairy ring]] code {{Fairycode|alp}}) after players complete [[Horror from the Deep]] (type 1 in the table). They can also be found in the southern part of the [[Catacombs of Kourend]], as well as the [[Jormungand's Prison]] after completion of [[The Fremennik Exiles]] (type 2 in the table).

This variant of dagannoth has three levels — 74, 92 and 100. The level 100 variant is fought before the dagannoth mother during the [[Horror from the Deep]] quest. It doesn't drop anything and cannot be fought again after the quest. It only uses a melee attack that can hit up to 9. The level 74 in the Lighthouse uses a [[ranged]] attack that hits up to 10, but has poor accuracy. The level 92 dagannoth uses [[melee]], which is more accurate and hits up to 8. In the other areas, both levels use melee. The Lighthouse basement is a [[multicombat area]] and therefore many players use [[dwarf multicannons]] to train here. A dwarf multicannon cannot be used within the Catacombs of Kourend. Despite the [[Combat]] level of these dagannoth, they are considered very weak by most players especially in comparison to the stronger [[Dagannoth (Waterbirth Island)|variant]] on [[Waterbirth Island]]. They also seem to be susceptible to poison. Players with decent defensive bonuses shouldn't have any trouble fighting for long periods of time.

