==Tips==
[[Protection prayers]], [[Bones to Peaches]], [[Guthan the Infested's equipment|Guthan's]], and the [[Saradomin godsword]] [[special attack]] are all viable means of surviving for extended periods. Players with 70 [[Prayer]] can use a [[dragonbone necklace]] and [[bonecrusher]]/[[bonecrusher necklace]] to sustain more prayer points.

The dagannoths in the [[Catacombs of Kourend]] can be safespotted, but not reliably. If using melee, the area near safespot 2 can be used to fight only one dagannoth at a time.

Safespot 3 works best when the Dagannoths are still in aggressive mode. They will line up in front of the Warped Jelly (having the Warped Jelly between you and the Dagannoths creates the safespot).

<gallery>
File:Dagannoth (Catacombs of Kourend, 1) safespot.png|Safespot 1
File:Dagannoth (Catacombs of Kourend, 2) safespot.png|Safespot 2
File:Dagannoth (Catacombs of Kourend, 3) safespot.png|Safespot 3
</gallery>

When killing the dagannoths in the Lighthouse, players can sell noted food to [[Jossik]] in the Lighthouse and buy it back in unnoted form for a small amount of money.

The dagannoths in [[Jormungand's Prison]] are in multi-combat, a cannon can be set, and only attack in melee. No food is required here if using [[Protect from Melee|Protect from Melee.]]

